// CustomModal.js
import React from 'react';

const RoomDetails = ({ showModal, handleClose }) => {
  return (
    <div className={showModal ? "modal show" : "modal"} tabIndex="-1" role="dialog" style={{ display: showModal ? "block" : "none" }}>
      <div className="modal-dialog modal-dialog-centered" role="document">
        <div className="modal-content">
          <div className="modal-header">
            <h5 className="modal-title">Room Details</h5>
            <button type="button" className="close" onClick={handleClose}>
              <span aria-hidden="true">&times;</span>
            </button>
          </div>
          <div className="modal-body">
            {/* Add your room details content here */}
          </div>
          <div className="modal-footer">
            <button type="button" className="btn btn-secondary" onClick={handleClose}>Close</button>
            {/* You can add additional buttons or actions here */}
          </div>
        </div>
      </div>
    </div>
  );
}

export default RoomDetails;
